script: |
  super -f text -I q12958.spq | sort > q12958.out

inputs:
  - name: q12958.spq
    data: |
      SELECT DISTINCT - col1 * 99 / + col0 + 45 AS col0 FROM tab0 (FORMAT parquet) WHERE + col2 BETWEEN NULL AND - - 11 OR NULL <= - col1 - col2;
  - name: tab0

outputs:
  - name: q12958.out
    data: |
